    container: {
      flex: 1,
      backgroundColor: colors.primaryD,
      alignItems: 'flex-start',
      justifyContent: 'flex-start',
      flexDirection: 'column',
    },
    gradient:{
        width: '100%',
        height: '100%',
        alignItems: 'flex-start',
        justifyContent: 'flex-start'
    },
  });

export default styles
